// index.js

import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'; // Remove the incorrect import of 'Switch'

// Form component
const FormPage = () => (
  <div>
    <h2>Form Page</h2>
    {/* Your form can go here */}
  </div>
);

// Home component with a button to navigate to the form page
const Home = () => (
  <div>
    <h1>Welcome to My App</h1>
    <button><Link to="/form">Go to Form Page</Link></button>
  </div>
);

// App component with routes
const App = () => (
  <Router>
    <Route path="/form" component={FormPage} />
    <Route path="/" component={Home} />
  </Router>
);

ReactDOM.render(<App />, document.getElementById('root'));
